import YelpIcon from "../images/yelpIcon.png";

const YelpComp = ({ yelpData }) => {
  return (
    <div className="col-span-2 ml-20 mt-4">
      <img
        className="bg-slate-100 pl-5 pr-5 rounded-lg mt-2 mb-2"
        src={YelpIcon}
        alt=""
        width="70rem"
      />
      {yelpData.map((data) => {
        return (
          <div className="text-slate-50 flex">
            {console.log(data)}
            <img
              src={data.image}
              className="rounded-full border-amber-500 border mr-4 self-start"
              alt="profile picture"
              width="50px"
            />
            <div className="text-area-yelp">
              <h1 className="font-bold font-serif">{data.name}</h1>
              <p>{data.location}</p>
              <p className="text-sm">{data.date_created}</p>
              <p>{data.comment}</p>
            </div>
          </div>
        );
      })}
    </div>
  );
};
export default YelpComp;
